// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract Land1 is ERC721 {
    uint256 public cost = 1 ether;
    uint256 public maxSupply = 5;
    uint256 public totalSupply = 0;

    uint256 public price = 2 ether;

    uint amount = 0; 

    address payable public owner; 

    struct Plot {
        string name;
        address owner;
        int256 posX;
        int256 posY;
        int256 posZ;
        uint256 sizeX;
        uint256 sizeY;
        uint256 sizeZ;
    }

    Plot[] public plots;

    event PropertyNftBought(address _owner, address _buyer, uint256 _price);

    constructor(
        string memory _name,
        string memory _symbol,
        uint256 _cost,
        uint256 _price
    ) ERC721(_name, _symbol) {
        cost = _cost;
        price = _price;


        plots.push(Plot('Plot 1', address(0x0), 0, 0, 0, 10, 10, 10));
        plots.push(Plot('Plot 2', address(0x0), 0, 10, 0, 10, 5, 3));
        plots.push(Plot('Plot 3', address(0x0), 0, -10, 0, 10, 5, 3));
        plots.push(Plot('Plot 4', address(0x0), 10, 0, 0, 5, 25, 5));
        plots.push(Plot('Plot 5', address(0x0), -10, 0, 0, 5, 25, 5));
    }

    function mint(uint256 _id) public payable {
        uint256 supply = totalSupply;
        require(supply <= maxSupply);
        require(plots[_id - 1].owner == address(0x0));
        require(msg.value >= cost);

        // tokenID starts from 1, array starts from 0
        plots[_id - 1].owner = msg.sender;
        totalSupply = totalSupply + 1;

        _safeMint(msg.sender, _id);
    }

    function getBuildings() public view returns (Plot[] memory) {
        return plots;
    }

    function getBuilding(uint256 _id) public view returns (Plot memory) {
        return plots[_id - 1];
    }
    //function transferFrom(
    //    address from,
    //    address to,
    //    uint256 tokenId
    //) public override {
    //    require(
    //        _isApprovedOrOwner(_msgSender(), tokenId),
    //        "ERC721: transfer caller is not owner nor approved"
    //    );

        // Update Plot ownership
    //    plots[tokenId - 1].owner = to;

    //    _transfer(from, to, tokenId);
    //}

    function allowBuy(uint256 _id, uint256 _price) external {
        require(msg.sender == ownerOf(_id), 'Not owner of this token');
        require(_price >= 2, 'Price zero');
        price = _price;
    }

    function disallowBuy(uint256 _id) external {
        require(msg.sender == ownerOf(_id), 'Not owner of this token');
        price = 0;
    }

    function buy(uint256 _id) external payable {
        price = price;
        require(price >= 2, 'This token is not for sale');
        require(msg.value >= price, 'Incorrect value');
        plots[_id - 1].owner = ownerOf(_id);
        _transfer(owner, msg.sender, _id);
        payable(owner).transfer(msg.value); 

        emit PropertyNftBought(owner, msg.sender, msg.value);
    }

    // Only the owner can execute functions
    modifier onlyOwner() {
        require(msg.sender == owner, 'Not owner');
        _;
    }
    function receiveFromBuyer() public payable{
        amount += msg.value;
    }

    function withdraw() public onlyOwner 
    {
        uint balance = address(this).balance;
        require(balance > 0, "Balance should be more then zero");
        payable(owner).transfer(balance);
        amount = 0;
    }

    function getBalance() public view returns (uint256){
       return amount;
    }
}
